import math
def hash(input) :
#                                                                                         komplizierte funktion zum hashen
        stageraw = int(input)                                                           
        stagesort = str(stageraw)[:45:]                                                 # letzte 45 stellen des Passwortes werden verarbeitet
        stageconvert = int(stagesort)                                                   # wieder zu int (ich weiß, das könnte man auch in der nächsten Zeile gleich mit machen)
        stage0 = bin(stageconvert) + "42"                                               # der Wert wird in bin-Zahl ümgewandelt, 42 addiert
        stage1 = (stage0 [2::])                                                         # 0b header für bin-Wert wird entfehrnt ---> bin Zahl wird als dec interpretiert
        stage2 = (int(stage1)**2) + 42                                                  # weniger komplizierte Mathe
        stage3 = (stage2 ) * math.ceil(math.log(int(stage0 [2:16:]),math.pi))           # brainfuck V1.0
        stage4 = stage3 ** ((2 ** math.ceil((math.sin(stage3)))+42))                    # Brainfuck Stufe 2
        fact = round(math.factorial(int(stage1 [2:7:])))                                # kurze Nebenoperation, weil ansonsten die Ausführung zu lange dauert
        stage5 = stage4 * round(math.pi ** 420) + round(int(stageraw)) + fact           # Aua mein Hirn geht kaputt
        stage6 = int(str(stageraw) + str(stageraw)+ str(stageraw)+ str(stageraw)+ str(stageraw)+ str(stageraw)+ str(stageraw)+ str(stageraw)+ str(stageraw) + "159870890213593708157004772") + stage5   # "Mit ein bissl Kopfrechnen bekommt man das schon raus"        ~~ Herr BTZ
        input_hashed = stage6
        return input_hashed

